import styled from "styled-components";

export const StyledCard = styled.div`
  width: 300px;
  /* height: 500px; */
  /* padding: 10px; */
  padding-top: 50px;
  margin-left: auto;
  margin-right: auto;
  border: 2px solid white;

  border-radius: 20px;
  box-shadow: 0px -5px 10px white;
`;
